@Tezla да я знаю, что это просто перевод "события"
просто в тему, политический ивент.
Просто в голову сразу пришло и комент оставил

@Paul de Zboev, спасибо за ответ. Теперь можно и поговорить. Как подтверждает ваш пример, боролись предки за справедливое будущее, олицетворением которого видели СССР. Но не за сам СССР как таковой, не за эти четыре буквы. 
Не из благодарности, что страна дала им голодомор, или гулаг, или дело врачей. 
Боролись из благодарности за справедливость и из надежды на светлое будущее для потомков.
